import Jumbotron from 'react-bootstrap/Jumbotron'
import 'bootstrap/dist/css/bootstrap.min.css'
import './css/style.css'

function App() {
  return (
    <div className="App">
      <Jumbotron className = "jumbotron-fluid text-center header bg-info">
        <h3>
          Login
        </h3>
      </Jumbotron>
    </div>
  );
}

export default App;
